import React from 'react'

class PortfolioElement extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <center>
                <div style={{width: '75%'}}>
                    <ImageGallery items={this.props.images} showPlayButton={false} showThumbnails={false}/>
                </div>
            </center>
        )
    }
}

export default PortfolioElement;
